import { useEffect, useState } from "react";

function ContactosCard({user}) {
    console.log('%cContactosCard.jsx line:5 contacto', 'color: #007acc;', user);
    const [u, setU] = useState({});
    useEffect(() => {
        setU(user);
    }, [user]);

    return (
        <div className="col-md-6 mb-2">
            <div className="card">
                <div className="card-body d-flex justify-content-between">
                    <div className="d-flex">

                        <div className="mr-3">
                            <p>{u.name}</p>
                            <p>{u.mail}</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default ContactosCard;
